  false,\n\t\"url\": null,\n\t\"notes\": \"This project is a cooperative effort among
  the National Ocean Service, National Centers for Coastal Ocean Science, Center for
  Coastal Monitoring and Assessment; U.S. Geological Survey; National Park Service;
  and the National Geophysical Data Center to produce benthic habitat maps and georeferenced
  imagery for Puerto Rico and the U.S. Virgin Islands. This project was conducted
  in support of the U.S. Coral Reef Task Force. These point data were generated while
  conducting ground validation during map preparation.\",\n\t\"license_title\": null,\n\t\"extras\":
